const EmpleadoItem = ({empleado}) =>{
    //console.log(empleado);
    return(
     <div className="col-md-4">
        <div className="card card-body">
        <h2 className="card-title"><strong>{empleado.nombre}</strong></h2>
        <p className="card-text"> </p>
        </div>
     </div>    
    )
}
